import logo from './logo.svg';
import './App.css';


class Chronometre extends componant {
  constructor(){
    super();
    this.state = {
      boardState: ['','','','','','','','',''],
      sockets: {},
      room: '',
      mySocketId: '',
      playerSign: '',
      currentTurn: 'X',
      status: 'unstarted',
    };
  }
}
function App() {
  return (
    <div className="App">
      <header className="Chronometre">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default Chronometre;
